import { Route, Routes } from 'react-router';
import useFetch from './utils/hooks/hook';

import ContextProvider from './utils/context/context';

import Login from './components/Login/Login';
import Error from './components/Error/Error';

import Dashboard from './pages/Dashboard/Dashboard';

import './utils/styles/App.css';

function App() {
	const { data, error, isLoading } = useFetch('http://localhost:8080/user/12');
	const user12 = {
		data: data,
		error: error,
		isLoading: isLoading,
	};

	const { data: data2, error: error2, isLoading: isLoading2 } = useFetch('http://localhost:8080/user/18');
	const user18 = {
		data: data2,
		error: error2,
		isLoading: isLoading2,
	};

	const users = [user12, user18];

	return (
		<ContextProvider>
			<Routes>
				<Route path="/" element={<Login users={users} />} />
				<Route path="/user/:id" element={<Dashboard />} />
				<Route path="*" element={<Error />} />
			</Routes>
		</ContextProvider>
	);
}

export default App;
